// https://leetcode.com/problems/longest-duplicate-substring/

// Given a string s, consider all duplicated substrings:
// (contiguous) substrings of s that occur 2 or more times.
// The occurrences may overlap.

// Return any duplicated substring that has the longest possible length.
// If s does not have a duplicated substring, the answer is "".

// 2 <= s.length <= 3 * 10^4
// s consists of lowercase English letters.

// Thoughts:
//  HashSet + largest cur length
//  if length > cur largest, update the HashSet
//  a set of found (and are the longest)
//
//  the problem is how to scan only once (ideally)
//  for fixed sliding window, you only need to scan once [LC480]
//  but there, the window is not fixed.
//
//  so scan from len(s)-1! then len(s)-2, len(s)-3, ..
//  each pass is a sliding window scan!
//  if dup is found, then return!

pub fn longest_dup_substring(s: String) -> String {
    use std::collections::HashSet;

    let max_len = s.len();
    let mut substr = HashSet::<&str>::new();
    let mut lhs = 0;
    let mut rhs = max_len;
    let mut cur_len = (lhs + rhs) / 2;

    let mut ans = "";
    loop {
        // for cur len, slide scan,
        // and loop cur len from outside.

        // @notice from discussion, we use
        //         bin search to update cur len
        // see also:
        //  https://tinyurl.com/vacb9wwj
        print!("cur len: {}, lhs {}, rhs {}", cur_len, lhs, rhs);

        for i in 0..(max_len - cur_len + 1) {
            let cur_str = &s[i..(i + cur_len)];
            if substr.contains(cur_str) {
                ans = cur_str;
            } else {
                substr.insert(cur_str);
            }
        }
        print!(", all {}", substr.len());
        substr.clear();

        // if dup found
        if ans.len() == cur_len {
            lhs = cur_len;
            println!(" *");
        } else {
            rhs = cur_len;
            println!("");
        }
        cur_len = (lhs + rhs) / 2;

        if lhs >= rhs - 1 {
            break;
        }
    }
    println!("--------");
    ans.into()
}

#[test]
fn run() {
    let mut s: String = "abab".into();
    assert_eq!(longest_dup_substring(s).as_str(), "ab");

    s = "abcbcabc".into();
    assert_eq!(longest_dup_substring(s).as_str(), "abc");

    s = "".into();
    assert_eq!(longest_dup_substring(s), "maoli");

    s = "abcd".into();
    assert_eq!(longest_dup_substring(s), "");

    s = "aabc".into();
    assert_eq!(longest_dup_substring(s), "a");

    // this is slow. need optimize. ~10 sec
    // s = "".into();
    // assert_eq!(longest_dup_substring(s), "jopojm");
}
